import React from 'react';
import { Pagination } from 'antd';

import PropTypes from 'prop-types';

export default function MyPagination({ total, changePage }) {
  console.log(total)
  return <Pagination onChange={(page, pageSize) => changePage(page, pageSize)} showSizeChanger={false} hideOnSinglePage defaultCurrent={1} pageSize={20} total={total} />;
}; // 1 pages per 10 items

MyPagination.defaultProps = {
  total: 1,
};

MyPagination.propTypes = {
  total: PropTypes.number,
};
